Does the service channel type meet the definition of a 'branch' as described below as at the relevant date?
To be considered a branch, the following minimum face-to-face services must all be provided:

- accepts cash and other deposits (including business deposits) and provides change;

- facilitates the keeping of accounts for customer access, including the provision of account balances;

- opens and closes accounts;

- can facilitate or arrange the assessment of the credit risk of existing and potential customers; and

- offers additional services in the one establishment such as financial services, business banking and specialist lending, if these are generally available from the reporting party. This need not mean that a financial adviser or business credit manager be available in the branch - the staff of the branch may simply act as a referral point for customers interested in these kinds of services.

Does the service channel type not meet the definition of a 'branch' as described below as at the relevant date, but does provide face-to-face services, such as, Agencies, Mobile Lenders, Head Offices etc?

To be considered a branch, the following minimum face-to-face services must all be provided.

- accepts cash and other deposits (including business deposits) and provides change;

- facilitates the keeping of accounts for customer access, including the provision of account balances;

- opens and closes accounts;

- can facilitate or arrange the assessment of the credit risk of existing and potential customers; and

- offers additional services in the one establishment such as financial services, business banking and specialist lending, if these are generally available from the reporting party. This need not mean that a financial adviser or business credit manager be available in the branch - the staff of the branch may simply act as a referral point for customers interested in these kinds of services.
